import "./Header.css"
import { ThemeContext } from '../App'

function Header() {
    const toggletheme =  () =>{
        setTheme((curr) => (curr==="light" ? "dark": "light"))
      }
  return (
    <nav>
        <h1 className="Heading">Remembo!</h1>
       { console.log(ThemeContext)}
        <button className="Toggle" onClick={toggletheme}>change me!</button>
    </nav>
  )
}

export default Header
